class RogueUnlocker
{
  pthread_mutex_t & mutex;
public:
  RogueUnlocker(pthread_mutex_t & mutex)
  : mutex(mutex)
  {
    pthread_mutex_lock(&mutex);
  }
  ~RogueUnlocker (void)
  {
    pthread_mutex_unlock(&mutex);
  }
};

